const Interests = () => {
    return(    
        <section class="resume-section" id="interests">
        <div class="resume-section-content">
            <h2 class="mb-5">興趣 Interests</h2>
            <p>不斷學習新技術之餘，也培養了不少的興趣，包含 : 排球、保齡球、烹飪</p>
            <p>閒暇時也樂於旅遊，到過的國家有 : 日本、加拿大、美國、香港</p>
            <p>也有些較靜態的興趣 : 鋼琴、影視、小說散文</p>
        </div>
    </section>
    );
}

export default Interests;
